%[text] ## Vertices
V = [0.5 0.5 1.0;... %[output:group:588e32ee] %[output:5a0039a7]
    0 0 0;... %[output:5a0039a7]
    1 0 0;... %[output:5a0039a7]
    0 1 0;... %[output:5a0039a7]
    1 1 0] %[output:group:588e32ee] %[output:5a0039a7]
%%
figure; %[output:4055c6c3]
scatter3(V(:,1),V(:,2),V(:,3),"filled") %[output:4055c6c3]
axis equal %[output:4055c6c3]
xlabel('x'); ylabel('y'); zlabel('z') %[output:4055c6c3]
%[text] 
%%
F = boundary(V) %[output:0a49658b]
%%
figure %[output:5c98b0ad]
hp = patch("Faces",F,"Vertices",V,"FaceColor",'flat'); %[output:5c98b0ad]
hp.FaceVertexCData = parula(6); %[output:5c98b0ad]
% colormap(parula(6))
axis vis3d %[output:5c98b0ad]
xlabel('x'); ylabel('y'); zlabel('z') %[output:5c98b0ad]
view([-129.28 -17.03]) %[output:5c98b0ad]
grid on %[output:5c98b0ad]

%%
% label_patches(F,V)
hAxes = findobj(gcf,"Type","axes");
%%
hAxes.CameraPosition = [4.9873,-6.2235,-2.6078]; %[output:72ce9395]
hAxes.CameraTarget = [0.5,0.5,0.5]; %[output:72ce9395]
hAxes.CameraUpVector = [0,0,1]; %[output:72ce9395]
hAxes.CameraViewAngle = 14.01; %[output:72ce9395]
%%
function label_patches(F, V)
hold on
% labels the faces and vertices of the inputted patches
offset = 0.025; % offset the label
% vertex label
for n=1:size(V,1)
    c = V(n,:) + offset; % grab row from Vertices array
    text(c(1), c(2),c(3), sprintf('V%d',n),"Color",'m')
end

% % faces label
% for n =1:size(F,1) 
%     c = mean(V(F(n,:),:)); % calculate the centroid of the triangle
%     text(c(1)+offset, c(2)+offset, c(3)+offset, sprintf('F%d',n),'Color','b','FontWeight','bold');
% end
end
%%
%[text] ## Surface Rendering
%[text] ### Generate Volume with Sphere
center1 = -10;
center2 = -center1;
dist = sqrt(3*(2*center1)^2);
radius = dist/2 * 1.4;
lims = [floor(center1-1.2*radius) ceil(center2+1.2*radius)];
[x,y,z] = meshgrid(lims(1):lims(2));
Vol = sqrt((x-center1).^2 + (y-center1).^2 + ...
    (z-center1).^2) <= radius;
%%
%[text] ### Display volume
volumeViewer(Vol)
%%
volshow(Vol) %[output:55c3b7b7]
%%
%[text] ### Create a surface from the volume
fv = isosurface(Vol, 0.5) %[output:58dfac22]
%%
figure %[output:50cff271]
hp = patch(fv,"FaceColor",'cyan'); %[output:50cff271]
axis vis3d %[output:50cff271]
xlabel('x'); ylabel('y'); zlabel('z') %[output:50cff271]
grid on %[output:50cff271]
view([-45 45]) %[output:50cff271]

hAxes = findobj(gcf,"Type","axes");
hAxes.CameraPosition = [-198.38,-198.38,331.06]; %[output:50cff271]
hAxes.CameraTarget = [31,31,31]; %[output:50cff271]
hAxes.CameraUpVector = [0,0,1]; %[output:50cff271]
hAxes.CameraViewAngle = 9.903; %[output:50cff271]
hAxes.Projection = "orthographic";
hAxes.FontSize=18; %[output:50cff271]

lighting gouraud %[output:50cff271]
%%
reducepatch(hp,0.1) %[output:0ef53afb]

